import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from './Components/Home';
import Layout from './hoc/Layout'

const Routes = () => {
  return (
    <Switch>
      <Route path="/" exact component= { Home }/>
    </Switch>
  )
};

export default Routes;
